pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "solidity-bytes-utils/contracts/BytesLib.sol";
import "openzeppelin-solidity/contracts/cryptography/MerkleProof.sol";

library Uniqys {
    using SafeMath for uint256;
    using BytesLib for bytes;

    uint8 constant public PRECOMMIT_ID = 2;

    struct ValidatorSet {
        mapping (address => uint256) powers;
        address[] validators;
        uint256 totalPower;
    }

    struct BlockHeader {
        uint64 height;
        uint64 timestamp;
        bytes32 lastBlockHash;
        bytes32 transactionRoot;
        bytes32 lastBlockConsensusRoot;
        bytes32 nextValidatorSetRoot;
        bytes32 appStateHash;
    }

    struct Transaction {
        address signer;
        bytes method;
        bytes path;
        bytes[2][] headers;
        bytes body;
    }

    function isConsented(
        ValidatorSet storage _vset,
        bytes32 _target,
        bytes[] memory _signatures
    )
        public
        view
        returns (bool)
    {
        uint256 _sum = 0;
        for (uint i = 0; i < _signatures.length; i++) {
            bytes32 _r;
            bytes32 _s;
            uint8 _v;
            (_r, _s, _v) = parseSignature(_signatures[i]);
            address _signer = ecrecover(_target, _v, _r, _s);
            require(_signer != address(0), "invalid");
            _sum = _sum.add(_vset.powers[_signer]);
        }
        if (_sum.mul(3) > _vset.totalPower.mul(2)) return true;
        return false;
    }

    function verifyBlockHeader(
        ValidatorSet storage _vset,
        BlockHeader memory _header,
        uint32 _consensusRound,
        bytes32 _genesisHash,
        bytes[] memory _signatures
    )
        public
        view
    {
        bytes32 _blockHash = keccak256(
            abi.encodePacked(
                _header.height, _header.timestamp,
                _header.lastBlockHash, _header.transactionRoot,_header.lastBlockConsensusRoot,
                _header.nextValidatorSetRoot, _header.appStateHash
            )
        );
        bytes32 _digest = keccak256(
            abi.encodePacked(
                _genesisHash, PRECOMMIT_ID, _header.height, _consensusRound, _blockHash
            )
        );
        require(isConsented(_vset, _digest, _signatures), "Consensus could not be verified");
    }

    function verifyTransaction(
        bytes32[] memory _proof,
        bytes32 _root,
        bytes32 _txHash
    )
        public
        view
    {
        require(
            MerkleProof.verify(_proof, _root, _txHash),
            "Could not prove transaction existence from proof"
        );
    }

    function parseSignature(bytes memory _signature) public view returns (bytes32 r, bytes32 s, uint8 v) {
        r = _signature.toBytes32(0);
        s = _signature.toBytes32(32);
        v = _signature.toUint8(64);
    }

    function parseTransaction(bytes memory _coreTransaction) public view returns (Transaction memory) {
        bytes32 _r;
        bytes32 _s;
        uint8 _v;

        // Transaction meta
        uint32 i = 1; // coreTx type UInt8

        // SizedBuffer
        bytes memory _transaction;
        (_transaction, i) = _sliceSizedBuffer(_coreTransaction, i);

        // reset
        i = 0;

        bytes memory _signature = _transaction.slice(i, 65);
        i += 65;
        bytes32 _digest = keccak256(_transaction.slice(i, _transaction.length - i));
        (_r, _s, _v) = parseSignature(_signature);
        // XXXX:
        if (_v < 2) _v += 27;
        address _signer = ecrecover(_digest, _v, _r, _s);

        // nonce
        i += 8;

        // Transaction body
        bytes memory _method;
        (_method, i) = _sliceSizedBuffer(_transaction, i);
        bytes memory _path;
        (_path, i) = _sliceSizedBuffer(_transaction, i);
        uint32 _headerNum = _transaction.toUint32(i);
        i += 4;

        bytes[2][] memory _header = new bytes[2][](_headerNum);
        for (uint j = 0; j < _headerNum; j++) {
            bytes memory _headerKey;
            (_headerKey, i) = _sliceSizedBuffer(_transaction, i);
            bytes memory _headerValue;
            (_headerValue, i) = _sliceSizedBuffer(_transaction, i);
            _header[j] = [_headerKey, _headerValue];
        }
        bytes memory _body;
        (_body, i) = _sliceSizedBuffer(_transaction, i);

        return Transaction(_signer, _method, _path, _header, _body);
    }

    function addressToString(address x) internal pure returns (string memory) {
        bytes memory b = new bytes(20);
        for (uint i = 0; i < 20; i++)
            b[i] = byte(uint8(uint(x) / (2**(8*(19 - i)))));
        return string(b);
    }

    function char(byte b) internal pure returns (byte c) {
        if (uint8(b) < 10) return byte(uint8(b) + 0x30);
        else return byte(uint8(b) + 0x57);
    }
    function bytesToBytes32(bytes memory b, uint offset) private pure returns (bytes32 out) {

        for (uint i = 0; i < 32; i++) {
            out |= bytes32(b[offset + i] & 0xFF) >> (i * 8);
        }
    }
    function bytes32string(bytes32 b32) internal pure returns (string memory out) {
        bytes memory s = new bytes(64);

        for (uint i = 0; i < 32; i++) {
            byte b = byte(b32[i]);
            byte hi = byte(uint8(b) / 16);
            byte lo = byte(uint8(b) - 16 * uint8(hi));
            s[i*2] = char(hi);
            s[i*2+1] = char(lo);
        }

        out = string(s);
    }

    function convertIntToString(uint256 _number) internal pure returns (string memory) {
        uint256 _tmpN = _number;

        if (_tmpN == 0) {
            return "0";
        }

        uint256 j = _tmpN;
        uint256 length = 0;

        while (j != 0){
            length++;
            j /= 10;
        }

        bytes memory bstr = new bytes(length);

        uint256 k = length - 1;

        while (_tmpN != 0) {
            bstr[k--] = byte(uint8(48 + _tmpN % 10));
            _tmpN /= 10;
        }

        return string(bstr);

    }

    function _sliceSizedBuffer(bytes memory _buf, uint32 _from) private view returns (bytes memory res, uint32 next) {
        next = _from;

        uint32 _size = _buf.toUint32(next);
        next += 4;

        res = _buf.slice(next, _size);
        next += _size;
    }
}
